# remove all zero-rows
############################################################################
my $num_rows = @$A;
my $num_cols = @{$A->[0]};
my $num_zero_rows = 0;
my $r_wk = 0;
for( my $r = 0; $r < $num_rows; $r++ )
{
   my $all_zero = 1;
   for( my $c = 0; $c < $num_cols; $c++ )
   {
      if( $A->[$r_wk][$c] != 0 )
      {
         $all_zero = 0;
         last;
      }
   }

   if( $all_zero )
   {
      $num_zero_rows++;
      print "r=$r, r_wk=$r_wk - all zeros\n";
      my $row = splice @$A, $r_wk, 1;
      # push @$A, $row;
   }
   else
   {
      $r_wk++;
   }
}
print "after putting all zero-rows to bottom!\n";
